// src/pages/DonoDetails.jsx
import React, { useEffect, useState } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function DonoDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [dono, setDono] = useState(null);
  const [form, setForm] = useState({ nome: '', cpf: '', endereco: '', responsavel: '', ativo: true });
  const [editando, setEditando] = useState(false);

  useEffect(() => {
    api.get(`/donos/${id}`).then(res => {
      setDono(res.data);
      setForm(res.data);
    });
  }, [id]);

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    setForm(prev => ({ ...prev, [name]: type === 'checkbox' ? checked : value }));
  };

  const handleUpdate = async e => {
    e.preventDefault();
    await api.put(`/donos/${id}`, form);
    setEditando(false);
    navigate('/donos');
  };

  const handleDelete = async () => {
    if (window.confirm('Deseja mesmo excluir este dono?')) {
      await api.delete(`/donos/${id}`);
      navigate('/donos');
    }
  };

  if (!dono) return <p>Carregando...</p>;

  return (
    <div className="container my-5">
      <h2>Detalhes do Dono</h2>
      <Link to="/donos" className="btn btn-secondary mb-3">← Voltar</Link>

      {editando ? (
        <form onSubmit={handleUpdate}>
          <div className="mb-3">
            <label className="form-label">Nome</label>
            <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
          </div>
          <div className="mb-3">
            <label className="form-label">CPF</label>
            <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} />
          </div>
          <div className="mb-3">
            <label className="form-label">Endereço</label>
            <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} />
          </div>
          <div className="mb-3">
            <label className="form-label">Responsável</label>
            <input name="responsavel" className="form-control" value={form.responsavel} onChange={handleChange} />
          </div>
          <div className="form-check mb-3">
            <input type="checkbox" className="form-check-input" name="ativo" checked={form.ativo} onChange={handleChange} />
            <label className="form-check-label">Ativo</label>
          </div>
          <button type="submit" className="btn btn-primary">Salvar</button>
        </form>
      ) : (
        <div>
          <p><strong>Nome:</strong> {dono.nome}</p>
          <p><strong>CPF:</strong> {dono.cpf}</p>
          <p><strong>Endereço:</strong> {dono.endereco}</p>
          <p><strong>Responsável:</strong> {dono.responsavel}</p>
          <p><strong>Ativo:</strong> {dono.ativo ? 'Sim' : 'Não'}</p>

          <button className="btn btn-warning me-2" onClick={() => setEditando(true)}>Editar</button>
          <button className="btn btn-danger" onClick={handleDelete}>Excluir</button>
        </div>
      )}
    </div>
  );
}
